@Maurício Santana Primeiramente tens de entender que no universo de Asimov os robôs poderiam criar consciência, atingir grandes habilidades e até se reprogramar, burlando barreiras impostas pelo criador no código.
Estamos muito longe de qualquer tipo de inteligência na programação atualmente, todo sistema de Machine Learning é feito para ter eficiência. Não teria como um robô utilizar o exemplo mencionado da felicidade "0" porque ele simplesmente não vai saber o que é felicidade, será que um sorriso pode ser uma simples felicidade ou um gesto de prazer? 
Até você pode criar uma máquina simulando uma voz ou jogando um jogo simulando ser uma pessoa com tensorflow, não existe muita dificuldade em criar programas que cumpram essa função, maior limitação é o hardware.

